                        flex-direction: column;
                        padding: .2rem 0;
                        width:100%;
                        .button-container {
                            width: calc(100% - 4px);
                            padding: 0;
                            margin: .1rem 0;
                            border-radius: 1rem;

                            &:last-child {
                                margin-bottom: 0;
                            }

                            button {
                                width: 100%;
                            }
                        }
                    }
                }
            }
        }
    }
